The Package contains two versions of RegDoctor made Portable. The first version of the program is made portable with the batch file that launches the program converted to an EXE with QBFC to avoid showing the relative DOS window, but that some AVs see sometimes as a virus. If your AV is one of them, or if you don&amp;#039;t trust too much to it, use the second one that runs directly the batch file. You will have the sloppy DOS window in the background but less complaints from antiviruses...


Enjoy and remember to seed... :o)
